import React from 'react';
import styles from './App.modules.css'


import {Cards,Chart,CountryPicker} from './components';

class App extends React.Component{
    render(){
        return(
         <div className ={styles.container}>
            <Cards/>
            <Chart />
            <CountryPicker />
         </div>   
        )
    }
}

export default App;
